// Granite.js
import React from 'react';

const graniteImages = [
  {
    image: 'blackgalaxy.jpg',
    title: 'Black Galaxy',

  },
  {
    image: 'blackgranite.jpg',
    title: 'Black Granite',
  },
  {
    image: 'baltic_brown.jpg',
    title: 'Baltic brown',

  },
  {
    image: 'bluepearl.jpg',
    title: 'Blue Pearl',

  },
  {
    image: 'browngranite.jpg',
    title: 'Brown Granite',

  },
  {
    image: 'camelbrown.jpg',
    title: 'Camel Brown',

  },
];

function Granite() {
  return (
    <div className="right-container">
      <div className="row">
        {graniteImages.slice(0, 3).map((product, index) => (
          <div key={index} className="col-md-4 mb-5">
            <img src={product.image} alt={product.title} className="stone-img" />
            <h5>{product.title}</h5>
               
          </div>
        ))}
      </div>
      <div className="row">
        {graniteImages.slice(3, 6).map((product, index) => (
          <div key={index} className="col-md-4 mb-5">
          <img src={product.image} alt={product.title} className="stone-img" />
          <h5>{product.title}</h5>
             
        </div>
        ))}
      </div>
    </div>
  );
}

export default Granite;
